script: |
  super -f text -I q1100.spq | sort > q1100.out

inputs:
  - name: q1100.spq
    data: |
      SELECT DISTINCT + 94 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1 WHERE NOT NULL IS NOT NULL;
  - name: tab0
  - name: tab1

outputs:
  - name: q1100.out
    data: |
      94
